							oContact= Object.create(ContactPoint);
							oContact.resourceType="ContactPoint";
							oContact.system="email";
							oContact.value=oTrackedEntity.attributes[iteratorAttribute].value;
							oContact.use="home";
							oContact.rank="2";
							oPatient.telecom.push(oContact);
							PatientSet=true;
